import React, { useState, useEffect } from 'react';
import axios from 'axios';
import CollectionDisplay from './browse-nfts/CollectionDisplay'

const Browse = () => {
  const [output, setOutput] = useState([]);
  const [collection, setCollection] = useState('');
  const [cursor, setCursor] = useState(null);
  const [hasMore, setHasMore] = useState(false);
  const [sort, setSort] = useState('');

  useEffect(() => {
    // Function to fetch data from the API
    const fetchData = async () => {
      try {
        const response = await axios.get('https://api.example.com/data'); // Replace with your API endpoint
        setOutput(response.data);
      } catch (err) {
        setOutput(["error"]);
      }
    };

    fetchData();
  }, [collection, cursor, sort, hasMore]);

  return (
    <main>
      <p align="center">Enter collection to search:</p>
      <form className="center" onSubmit={handleSubmit}>
        <input 
          type="text" 
          value={walletAddress}
          onChange={(e) => setCollection(e.target.value)}
        />

        <button type="submit">Search</button>
      </form>
      <CollectionDisplay content={output} />
      {hasMore && (
      <div className="load-more">
        <p>Scroll to reveal more collectionns...</p>
      </div>
      )}
    </main>
  );
};

export default Browse;
